import React from 'react'
import {Link} from 'react-router-dom'

function Cart({}) {
  return (
    <div>
      <p>Cart</p>
      <Link to={`/Cart/${Cart.id}`}><h1>{Cart.title}</h1></Link>
    </div>
  )
}

export default Cart
